sys_variable_value.value:
(function(outputs, steps, stepResult, assertEqual)
{
	var test = new x_snc_devtools.TestAPI(outputs, steps, stepResult, assertEqual);
	
	test.SetResult(true);

	function TestCase_GetDeploymentStates(strState,vExpected)
	{
		function TestCase_GetDeploymentStates_CheckResult(vInput,vExpected,vResult)
		{
			return (x_snc_devtools.GetValue(vResult,strState) == vExpected);
		}

		test.TestCase(
			'Function GetDeploymentStates()',
			GetDeploymentStates,
			{},
			vExpected,
			TestCase_GetDeploymentStates_CheckResult);
	}

	TestCase_GetDeploymentStates(null,null);
	TestCase_GetDeploymentStates('draft',1000);
	TestCase_GetDeploymentStates('ready',2000);
	TestCase_GetDeploymentStates('complete',10000);
	
	return test.GetResult();
	
})(outputs, steps, stepResult, assertEqual);
